        .to("#main-visual .cls-2", { opacity: 1, duration: 1, ease: "linear" })
        .to("#main-visual .cls-3", { opacity: 1, duration: 1, ease: "linear" })
        .from("#main-visual .title .char", { opacity: 0, y: -150, duration: 1, stagger: { each: 0.1 }, ease: "back" });
    </script>
  </body>
</html>
